class Solution:
    def findMaximumNumber(self, k: int, x: int) -> int:
        def count_set_bits(n):
            count = 0
            while n:
                count += n & 1
                n >>= 1
            return count

        def count_price(n, x):
            count = 0
            i = 1
            while i <= n:
                if (i & (i >> (x - 1))) != 0:
                    count += 1
                i += 1
            return count

        low, high = 1, k
        while low < high:
            mid = (low + high + 1) // 2
            total_price = sum(count_price(i, x) for i in range(1, mid + 1))
            if total_price <= k:
                low = mid
            else:
                high = mid - 1
        return low
```

