class Solution:
    def beautifulIndices(self, s: str, a: str, b: str, k: int) -> List[int]:
        n = len(s)
        m, p = len(a), len(b)
        res = []
        for i in range(n - m + 1):
            if s[i:i+m] == a:
                for j in range(max(0, i-k), min(n-p+1, i+k+1)):
                    if s[j:j+p] == b:
                        res.append(i)
                        break
        return sorted(res)
```

