class Solution:
    def minOperations(self, nums: List[int], k: int) -> int:
        xor = 0
        for num in nums:
            xor ^= num
        if xor == k:
            return 0
        res = float('inf')
        for num in nums:
            new_xor = xor ^ num
            cnt = bin(new_xor ^ k).count('1')
            res = min(res, cnt)
