class Solution:
    def minOrAfterOperations(self, nums: List[int], k: int) -> int:
        n = len(nums)
        res = nums[:]
        for _ in range(k):
            new_res = []
            i = 0
            while i < n:
                if i < n - 1:
                    new_res.append(res[i] & res[i + 1])
                    i += 2
                else:
                    new_res.append(res[i])
                    i += 1
            res = new_res
            n = len(res)
        or_val = 0
        for num in res:
            or_val |= num
        return or_val
```

