class Solution:
    def minOrAfterOperations(self, nums: List[int], k: int) -> int:
        n = len(nums)
        res = nums[0]
        for i in range(1, n):
            res |= nums[i]
        while k > 0:
            new_nums = []
            i = 0
            while i < n - 1:
                new_nums.append(nums[i] & nums[i + 1])
                i += 2
            if i == n - 1:
                new_nums.append(nums[i])
            nums = new_nums
            n = len(nums)
            k -= (n + 1) // 2
        res = 0
        for num in nums:
            res |= num
        return res
