class Solution:
    def minOrAfterOperations(self, nums: List[int], k: int) -> int:
        n = len(nums)
        res = [0] * (n + 1)
        res[0] = nums[0]
        for i in range(1, n):
            res[i] = res[i - 1] | nums[i]

        for _ in range(k):
            mx = 0
            idx = -1
            for i in range(n - 1):
                if res[i] < res[i + 1]:
                    mx = max(mx, res[i + 1] ^ (res[i + 1] & nums[i]))
                    idx = i
            if idx != -1:
                res[idx + 1] = mx
            else:
                break

        return res[-1]
