    def maximumPoints(self, enemyEnergies: List[int], currentEnergy: int) -> int:
        enemyEnergies.sort()
        dp = [0] * (currentEnergy + 1)
        for energy in enemyEnergies:
            for j in range(currentEnergy, energy - 1, -1):
                dp[j] = max(dp[j], dp[j - energy] + 1)
        return dp[-1]
