class Solution:
    def earliestSecondToMarkIndices(self, nums: List[int], changeIndices: List[int]) -> int:
        count = {i: 0 for i in range(1, len(nums) + 1)}
        for i in changeIndices:
            count[i] += 1
        seconds = 0
        for i in range(len(nums)):
            if count[i + 1] == 0:
                return -1
            seconds += nums[i]
        return seconds + len(changeIndices)
