class Solution:
    def earliestSecondToMarkIndices(self, nums: List[int], changeIndices: List[int]) -> int:
        count = [0] * len(nums)
        for i in changeIndices:
            count[i - 1] += 1
        seconds = 0
        for i in range(len(nums)):
            if count[i] == 0:
                return -1
            seconds = max(seconds, (nums[i] + count[i] - 1) // count[i])
        return seconds
