        num_count = {}
        for num in nums:
            num_count[num] = num_count.get(num, 0) + 1

        for num in num_count:
            length = 0
            x = num
            while x in num_count:
                length += num_count[x]
                x *= x
            x = num
            while x in num_count:
                length += num_count[x]
                x = int(x ** 0.5)
            max_length = max(max_length, length)

        return max_length
