class Solution:
    def maximumStrength(self, nums: List[int], k: int) -> int:
        n = len(nums)
        prefix_sum = [0] * (n + 1)
        for i in range(n):
            prefix_sum[i + 1] = prefix_sum[i] + nums[i]

        dp = [[[0] * (k + 1) for _ in range(n + 1)] for _ in range(n + 1)]

        for i in range(1, n + 1):
            for j in range(1, min(i, k) + 1):
                for x in range(1, i + 1):
                    if j == 1:
                        dp[i][j][x] = max(dp[i - 1][j][x - 1], prefix_sum[i] - prefix_sum[i - x] * x + (x - 1) * dp[i - x][j - 1][x - 1] if i >= x else 0)
                    else:
                        dp[i][j][x] = max(dp[i - 1][j][x], dp[i - x][j - 1][x - 1] + (-1) ** (x - 1) * (prefix_sum[i] - prefix_sum[i - x]) * (x - i + j))

        return dp[n][k][k]
```

