class Solution:
    def maxPalindromesAfterOperations(self, words: List[str]) -> int:
        count = [{} for _ in range(26)]
        for word in words:
            freq = {}
            for char in word:
                freq[ord(char) - ord('a')] = freq.get(ord(char) - ord('a'), 0) + 1
            for key in freq:
                count[key][freq[key]] = count[key].get(freq[key], 0) + 1
        res = 0
        for i in range(26):
            for j in range(25, -1, -1):
                if count[i].get(j, 0) > 0:
                    res += j // 2 * 2
                    if j % 2 == 1:
                        res += 1
                    break
        return res
