    def maxPalindromesAfterOperations(self, words: List[str]) -> int:
        count = [0] * 26
        for word in words:
            freq = [0] * 26
            for char in word:
                freq[ord(char) - ord('a')] += 1
            odd_count = sum(f % 2 for f in freq)
            count[odd_count] += 1
        res = 0
        for i in range(25, -1, -2):
            res += count[i]
            if i > 0:
                res += count[i - 1] // 2 * 2
        return res
