class Solution:
    def minimumMoves(self, nums: List[int], k: int, maxChanges: int) -> int:
        n = len(nums)
        ones = []
        for i in range(n):
            if nums[i] == 1:
                ones.append(i)
        if k > len(ones):
            return -1
        res = float('inf')
        for i in range(n):
            changes = 0
            ones_picked = 0
            j = i
            while ones_picked < k:
                while j < n and nums[j] == 0:
                    j += 1
                if j == n:
                    break
                ones_picked += 1
                changes += j - i
                if j - i > maxChanges:
                    break
                j += 1
            if ones_picked == k:
                res = min(res, changes)
        return res if res != float('inf') else -1
