class Solution:
    def getSmallestString(self, s: str, k: int) -> str:
        n = len(s)
        res = list(s)
        for i in range(n):
            d = min(k, ord('z') - ord(s[i]) + 1)
            res[i] = chr(ord('a') + d - 1)
            k -= d
        return ''.join(res)
```

