class Solution:
    def getSmallestString(self, s: str, k: int) -> str:
        n = len(s)
        res = list(s)
        for i in range(n):
            d = min(ord(res[i]) - ord('a'), ord('z') - ord(res[i]) + 1)
            if k >= d:
                k -= d
                res[i] = 'a'
            else:
                res[i] = chr((ord(res[i]) - ord('a') + k) % 26 + ord('a'))
                k = 0
        return ''.join(res)
