class Solution:
    def shortestSubstrings(self, arr: List[str]) -> List[str]:
        def all_substrings(s):
            return [s[i: j] for i in range(len(s)) for j in range(i + 1, len(s) + 1)]

        def is_unique(sub, arr, idx):
            for i, s in enumerate(arr):
                if i != idx and sub in s:
                    return False
            return True

        res = []
        for i, s in enumerate(arr):
            subs = all_substrings(s)
            subs.sort()
            for sub in subs:
                if is_unique(sub, arr, i):
                    res.append(sub)
                    break
            else:
                res.append("")
        return res
```

