class Solution:
    def minimumDeletions(self, word: str, k: int) -> int:
        freq = {}
        for char in word:
            if char in freq:
                freq[char] += 1
            else:
                freq[char] = 1

        freq_values = sorted(list(freq.values()))
        n = len(freq_values)

        res = float('inf')
        left, right = 0, n - 1
        while left <= right:
            mid = (left + right) // 2
            if max(freq_values) - min(freq_values[:mid + 1]) <= k:
                res = min(res, len(word) - sum(freq_values[:mid + 1]))
                right = mid - 1
            else:
                left = mid + 1

        return res
