class Solution:
    def longestMonotonicSubarray(self, nums: List[int]) -> int:
        if not nums:
            return 0

        inc, dec = [1]*len(nums), [1]*len(nums)
        for i in range(1, len(nums)):
            if nums[i] > nums[i-1]:
                inc[i] = inc[i-1] + 1
            if nums[i] < nums[i-1]:
                dec[i] = dec[i-1] + 1

        return max(max(inc), max(dec))
