import heapq

class Solution:
    def findKthSmallest(self, coins: List[int], k: int) -> int:
        pq = [0]
        visited = set([0])
        for _ in range(k):
            curr = heapq.heappop(pq)
            for coin in coins:
                nxt = curr + coin
                if nxt not in visited:
                    visited.add(nxt)
                    heapq.heappush(pq, nxt)
        return curr
```

