class Solution:
    def stringIndices(self, wordsContainer: List[str], wordsQuery: List[str]) -> List[int]:
        def common_suffix_len(str1, str2):
            i = min(len(str1), len(str2))
            while i > 0:
                if str1[-i:] == str2[-i:]:
                    return i
                i -= 1
            return 0

        ans = []
        for query in wordsQuery:
            max_suffix_len = 0
            min_len = float('inf')
            idx = -1
            for i, container in enumerate(wordsContainer):
                suffix_len = common_suffix_len(query, container)
                if suffix_len > max_suffix_len or (suffix_len == max_suffix_len and len(container) < min_len):
                    max_suffix_len = suffix_len
                    min_len = len(container)
                    idx = i
            ans.append(idx)
        return ans
```

