class Solution:
    def minimumSubarrayLength(self, nums: List[int], k: int) -> int:
        if not nums:
            return -1

        res = float('inf')
        left = 0
        curr_or = 0

        for right in range(len(nums)):
            curr_or |= nums[right]

            while curr_or >= k:
                res = min(res, right - left + 1)
                curr_or ^= nums[left]
                left += 1

        return res if res != float('inf') else -1
