    def numberOfRightTriangles(self, grid: List[List[int]]) -> int:
        rows, cols = len(grid), len(grid[0])
        row_counts = [{i: 0 for i in range(cols)} for _ in range(rows)]
        col_counts = [{i: 0 for i in range(rows)} for _ in range(cols)]

        for i in range(rows):
            for j in range(cols):
                if grid[i][j] == 1:
                    row_counts[i][j] += 1
                    col_counts[j][i] += 1

        triangles = 0
        for i in range(rows):
            for j in range(cols):
                if grid[i][j] == 1:
                    triangles += sum(row_counts[i].values()) - row_counts[i][j]
                    triangles += sum(col_counts[j].values()) - col_counts[j][i]

        return triangles // 3
