class Solution:
    def minAnagramLength(self, s: str) -> int:
        from collections import Counter
        n = len(s)
        counter = Counter(s)
        g = n
        for i in range(1, n // 2 + 1):
            if n % i == 0:
                temp = Counter()
                for j in range(i):
                    temp += Counter(s[j::i])
                if all(v % i == 0 for v in temp.values()):
                    g = min(g, i)
