class Solution:
    def minCostToEqualizeArray(self, nums: List[int], cost1: int, cost2: int) -> int:
        MOD = 10**9 + 7
        max_val = max(nums)
        min_cost = float('inf')

        for target in range(max_val, max_val + len(nums)):
            cost = 0
            for num in nums:
                if target - num > 0:
                    cost += min((target - num) * cost1, (target - num - 1) // 2 * cost2 + (target - num - 1) % 2 * cost1)
            min_cost = min(min_cost, cost)

        return min_cost % MOD
```

