                    if i > 0:
                        dp[i][j][k] += dp[i-1][j][k]
                        dp[i][j][k] %= MOD
                    if j > 0:
                        dp[i][j][k] += dp[i][j-1][min(k-1, 1)]
                        dp[i][j][k] %= MOD

        return dp[zero][one][limit]
