class Solution:
    def valueAfterKSeconds(self, n: int, k: int) -> int:
        MOD = 10**9 + 7
        dp = [[0]*(n+1) for _ in range(k+1)]
        dp[0][0] = 1
        for i in range(k+1):
            for j in range(1, n+1):
                dp[i][j] = (dp[i][j-1] + dp[i-1][j-1] if i > 0 else 0) % MOD
        return dp[k][n]
```

