class Solution:
    def duplicateNumbersXOR(self, nums: List[int]) -> int:
        xor = 0
        for num in nums:
            xor ^= num
        return xor
```
This solution works because the XOR operation has the property that `a ^ a = 0` and `a ^ 0 = a`. Therefore, when we XOR all numbers in the array, the numbers that appear once will cancel each other out, and the numbers that appear twice will remain.

