    def validStrings(self, n: int) -> List[str]:
        def is_valid(s):
            for i in range(len(s) - 1):
                if s[i:i+2] == "00":
                    return False
            return True

        def generate_strings(n, current, result):
            if n == 0:
                if is_valid(current):
                    result.append(current)
                return
            generate_strings(n - 1, current + "0", result)
            generate_strings(n - 1, current + "1", result)

        result = []
        generate_strings(n, "", result)
        return result
