        prefix = [0] * (n + 1)
        for i in range(n):
            prefix[i + 1] = prefix[i] + nums[i] * ((-1) ** i)

        dp = [[0] * (n + 1) for _ in range(n + 1)]
        for i in range(1, n + 1):
            for j in range(1, i + 1):
                dp[i][j] = max(dp[i - 1][k] + prefix[i] - prefix[k] for k in range(j - 1, i))

        return dp[n][n]
