class Solution:
    def minimumCost(self, m: int, n: int, horizontalCut: List[int], verticalCut: List[int]) -> int:
        MOD = 10**9 + 7
        horizontalCut.sort(reverse=True)
        verticalCut.sort(reverse=True)

        h, v = len(horizontalCut), len(verticalCut)
        hPrefix, vPrefix = [0]*(h+1), [0]*(v+1)
        for i in range(h):
            hPrefix[i+1] = hPrefix[i] + horizontalCut[i]
        for i in range(v):
            vPrefix[i+1] = vPrefix[i] + verticalCut[i]

        res = 0
        for i in range(h+1):
            for j in range(v+1):
                x, y = m - (h - i), n - (v - j)
                res = max(res, (x*y) % MOD * (hPrefix[i] + vPrefix[j]) % MOD)
        return res
```

