class Solution:
    def minNumberOfSeconds(self, mountainHeight: int, workerTimes: List[int]) -> int:
        def calculate_time(worker_time, height):
            time = 0
            for i in range(1, height + 1):
                time += worker_time * i
            return time

        times = []
        for worker_time in workerTimes:
            time = 0
            height = 0
            while height < mountainHeight:
                height += 1
                time = calculate_time(worker_time, height)
                times.append(time)

        return min(times)
```

