    def shortestDistanceAfterQueries(self, n: int, queries: List[List[int]]) -> List[int]:
        graph = [[] for _ in range(n)]
        for i in range(n - 1):
            graph[i].append(i + 1)

        distance = [float('inf')] * n
        distance[0] = 0

        for u, v in queries:
            graph[u].append(v)
            queue = [0]
            temp_distance = [float('inf')] * n
            temp_distance[0] = 0
            while queue:
                node = queue.pop(0)
                for neighbor in graph[node]:
                    if temp_distance[neighbor] > temp_distance[node] + 1:
                        temp_distance[neighbor] = temp_distance[node] + 1
                        queue.append(neighbor)
            distance = temp_distance

        return distance[1:]
