        colors = colors + colors  # duplicate the array to handle circular case
        res = []
        for query in queries:
            if query[0] == 1:
                size = query[1]
                count = 0
                for i in range(n):
                    alt = True
                    for j in range(1, size):
                        if colors[i + j] == colors[i + j - 1]:
