        n = len(colors)
        dp = [[0] * 2 for _ in range(n)]
        dp[0][colors[0]] = 1
        for i in range(1, n):
            dp[i][1 - colors[i]] = dp[i - 1][colors[i]] + 1
        res = []
        for query in queries:
            if query[0] == 1:
                size = query[1]
                cnt = 0
                for i in range(n):
                    if dp[i][1 - colors[i]] >= size:
                        cnt += 1
                res.append(cnt)
            else:
                idx, color = query[1], query[2]
                if colors[idx] != color:
                    colors[idx] = color
                    dp[idx][1 - color] = dp[idx - 1][color] + 1
                    for i in range(idx + 1, n):
                        dp[i][1 - colors[i]] = dp[i - 1][colors[i]] + 1
                    for i in range(idx - 1, -1, -1):
                        dp[i][1 - colors[i]] = dp[i + 1][colors[i]] + 1
        return res
```

