class Solution:
    def minDamage(self, power: int, damage: List[int], health: List[int]) -> int:
        pq = []
        for i in range(len(damage)):
            heapq.heappush(pq, (-damage[i], health[i]))

        total_damage = 0
        while pq:
            temp = []
            total_temp_damage = 0
            for _ in range(len(pq)):
                d, h = heapq.heappop(pq)
                total_temp_damage -= d
                h -= power
                if h > 0:
                    temp.append((d, h))
            total_damage += total_temp_damage
            for d, h in temp:
                heapq.heappush(pq, (d, h))

        return total_damage
