from collections import defaultdict, deque
class Solution:
    def timeTaken(self, edges: List[List[int]]) -> List[int]:
        n = len(edges) + 1
        graph = defaultdict(list)
        for u, v in edges:
            graph[u].append(v)
            graph[v].append(u)

        res = [0] * n
        for i in range(n):
            dist = [-1] * n
            dist[i] = 0
            q = deque([i])
            while q:
                node = q.popleft()
                for neighbor in graph[node]:
                    if dist[neighbor] == -1:
                        dist[neighbor] = dist[node] + 1
                        q.append(neighbor)
            for j in range(n):
                if j != i:
                    if j % 2 == 0:
                        res[i] = max(res[i], dist[j] * 2)
                    else:
                        res[i] = max(res[i], dist[j] * 2 - 1)
        return res
```

