from itertools import permutations
from math import factorial

class Solution:
    def countGoodIntegers(self, n: int, k: int) -> int:
        count = 0
        for p in permutations(range(10), n):
            num = int(''.join(map(str, p)))
            if num % k == 0 and str(num) == str(num)[::-1]:
                count += 1
            for i in range(n):
                for j in range(i + 1, n):
                    num = list(str(num))
                    num[i], num[j] = num[j], num[i]
                    num = int(''.join(num))
                    if num % k == 0 and str(num) == str(num)[::-1]:
                        count += 1
                        break
                else:
                    continue
                break
        return count // (factorial(n) // (factorial(n // 2) ** 2))
