from collections import deque
from typing import List

class Solution:
    def maxMoves(self, kx: int, ky: int, positions: List[List[int]]) -> int:
        directions = [(2, 1), (1, 2), (-1, 2), (-2, 1), (-2, -1), (-1, -2), (1, -2), (2, -1)]

        def bfs(x, y, target_x, target_y):
            queue = deque([(x, y, 0)])
            visited = {(x, y)}
            while queue:
                x, y, step = queue.popleft()
                if (x, y) == (target_x, target_y):
                    return step
                for dx, dy in directions:
                    nx, ny = x + dx, y + dy
                    if (nx, ny) not in visited and 0 <= nx < 50 and 0 <= ny < 50:
                        queue.append((nx, ny, step + 1))
                        visited.add((nx, ny))
            return float('inf')

        memo = {}
        def dfs(turn, positions):
            if not positions:
                return 0
            if (turn, tuple(map(tuple, positions))) in memo:
                return memo[(turn, tuple(map(tuple, positions)))]
            if turn == 0:
                res = 0
                for i, (x, y) in enumerate(positions):
                    step = bfs(kx, ky, x, y)
                    res = max(res, step + dfs(1, positions[:i] + positions[i+1:]))
                memo[(turn, tuple(map(tuple, positions)))] = res
                return res
            else:
                res = float('inf')
                for i, (x, y) in enumerate(positions):
                    step = bfs(kx, ky, x, y)
                    res = min(res, step + dfs(0, positions[:i] + positions[i+1:]))
                memo[(turn, tuple(map(tuple, positions)))] = res
                return res

        return dfs(0, positions)
