from collections import deque
from typing import List

class Solution:
    def maxMoves(self, kx: int, ky: int, positions: List[List[int]]) -> int:
        def bfs(x: int, y: int) -> List[int]:
            queue = deque([(x, y, 0)])
            visited = {(x, y)}
            moves = []
            while queue:
                cx, cy, cm = queue.popleft()
                for dx, dy in [(-2, -1), (-2, 1), (-1, -2), (-1, 2), (1, -2), (1, 2), (2, -1), (2, 1)]:
                    nx, ny = cx + dx, cy + dy
                    if 0 <= nx < 50 and 0 <= ny < 50 and (nx, ny) not in visited:
                        queue.append((nx, ny, cm + 1))
                        visited.add((nx, ny))
                        if [nx, ny] in positions:
                            moves.append(cm + 1)
            return moves

        memo = {}
        def dfs(i: int, x: int, y: int) -> int:
            if i == len(positions):
                return 0
            if (i, x, y) in memo:
                return memo[(i, x, y)]
            max_moves = 0
            for j in range(i, len(positions)):
                px, py = positions[j]
                moves = bfs(x, y)
                if moves:
                    max_moves = max(max_moves, moves[0] + dfs(j + 1, px, py))
            memo[(i, x, y)] = max_moves
            return max_moves

        return dfs(0, kx, ky)
