from collections import deque
from typing import List

class Solution:
    def maxMoves(self, kx: int, ky: int, positions: List[List[int]]) -> int:
        directions = [(2, 1), (1, 2), (-1, 2), (-2, 1), (-2, -1), (-1, -2), (1, -2), (2, -1)]
        memo = {}

        def bfs(x, y, target_x, target_y):
            if (x, y, target_x, target_y) in memo:
                return memo[(x, y, target_x, target_y)]
            queue = deque([(x, y, 0)])
            visited = {(x, y)}
            while queue:
                cx, cy, step = queue.popleft()
                if (cx, cy) == (target_x, target_y):
                    memo[(x, y, target_x, target_y)] = step
                    return step
                for dx, dy in directions:
                    nx, ny = cx + dx, cy + dy
                    if 0 <= nx < 50 and 0 <= ny < 50 and (nx, ny) not in visited:
                        queue.append((nx, ny, step + 1))
                        visited.add((nx, ny))
            memo[(x, y, target_x, target_y)] = float('inf')
            return float('inf')

        def dfs(pawns, x, y, is_alice):
            if not pawns:
                return 0
            if (tuple(pawns), x, y, is_alice) in memo:
                return memo[(tuple(pawns), x, y, is_alice)]
            res = float('-inf') if is_alice else float('inf')
            for i, (px, py) in enumerate(pawns):
                step = bfs(x, y, px, py)
                npawns = pawns[:i] + pawns[i + 1:]
                nx, ny = px, py
                val = dfs(npawns, nx, ny, not is_alice) + step
                if is_alice:
                    res = max(res, val)
                else:
                    res = min(res, val)
            memo[(tuple(pawns), x, y, is_alice)] = res
            return res

        return dfs(positions, kx, ky, True)
