class Solution:
    def maxScore(self, grid: List[List[int]]) -> int:
        m, n = len(grid), len(grid[0])
        dp = [[set() for _ in range(n)] for _ in range(m)]

        def dfs(i, used):
            if i == m:
                return 0
            res = 0
            for j in range(n):
                if grid[i][j] not in used:
                    dp[i][j].add(grid[i][j])
                    res = max(res, grid[i][j] + dfs(i + 1, dp[i][j]))
                    dp[i][j].remove(grid[i][j])
            return res

        return dfs(0, set())
