class Solution:
    def maxValue(self, nums: List[int], k: int) -> int:
        n = len(nums)
        max_xor = 0
        for i in range(n):
            left = 0
            right = 0
            for j in range(i, n):
                left |= nums[j]
                if j - i + 1 >= k:
                    right |= nums[j - k + 1]
                    max_xor = max(max_xor, left ^ right)
        return max_xor
```

