        for i in range(2**n):
            seq = [nums[j] for j in range(n) if (i >> j) & 1]
            if len(seq) == 2 * k:
                val = (reduce(or_, seq[:k]) ^ reduce(or_, seq[k:]))
                max_val = max(max_val, val)
        return max_val
