            dragon[0] = (dragon[0][0], dragon[0][1] + 1)
        elif direction == 'D':
            dragon[0] = (dragon[0][0], dragon[0][1] - 1)
        dragon.rotate(-1)
    else:
        p = int(query[1])
        print(*dragon[p - 1])
