from collections import deque

H, W, K = map(int, input().split())
grid = [input() for _ in range(H)]

def bfs():
    queue = deque([(i, j) for i in range(H) for j in range(W) if grid[i][j] == 'o'])
    visited = [[False] * W for _ in range(H)]
    for i, j in queue:
        visited[i][j] = True
    while queue:
        i, j = queue.popleft()
        for x, y in [(i-1, j), (i+1, j), (i, j-1), (i, j+1)]:
            if 0 <= x < H and 0 <= y < W and grid[x][y] == '.' and not visited[x][y]:
                queue.append((x, y))
                visited[x][y] = True
    return visited

def check_horizontal(visited):
    for i in range(H):
        for j in range(W - K + 1):
            if all(visited[i][j+k] for k in range(K)):
                return True
    return False

def check_vertical(visited):
    for i in range(H - K + 1):
        for j in range(W):
            if all(visited[i+k][j] for k in range(K)):
                return True
    return False

visited = bfs()
if check_horizontal(visited) or check_vertical(visited):
    count = 0
    for i in range(H):
        for j in range(W):
            if grid[i][j] == '.':
                count += 1
    print(count)
else:
    print(-1)
