from collections import defaultdict, deque
from typing import List, Tuple

def solve() -> None:
    N, M = map(int, input().split())
    trains: List[Tuple[int, int, int, int, int, int]] = []
    for _ in range(M):
        l, d, k, c, A, B = map(int, input().split())
        trains.append((l, d, k, c, A, B))

    graph: defaultdict[List[Tuple[int, int]]] = defaultdict(list)
    for l, d, k, c, A, B in trains:
        for t in range(l, l + d * (k - 1) + 1, d):
            graph[A].append((t, t + c, B))

    INF = 10**18
    dp: List[int] = [-INF] * (N + 1)
    dp[1] = 0
    queue: deque[int] = deque([1])

    while queue:
        node = queue.popleft()
        for t, tt, next_node in graph[node]:
            if tt > dp[node]:
                dp[next_node] = max(dp[next_node], tt)
                if next_node not in queue:
                    queue.append(next_node)

    for i in range(1, N):
        if dp[i] == -INF:
            print("Unreachable")
        else:
            print(dp[i])

if __name__ == "__main__":
    solve()
