    def can_place_tile(h, w, a, b):
        if a > h or b > w:
            a, b = b, a
        if a > h or b > w:
            return False
        return True

    def dfs(h, w, idx, used, grid):
        if idx == N:
            return True
        for i in range(h):
            for j in range(w):
                if grid[i][j] == 0:
                    for a, b in [(tiles[idx][0], tiles[idx][1]), (tiles[idx][1], tiles[idx][0])]:
                        if can_place_tile(h - i, w - j, a, b):
                            for x in range(i, i + a):
                                for y in range(j, j + b):
                                    grid[x][y] = 1
                            if dfs(h, w, idx + 1, used | (1 << idx), grid):
                                return True
                            for x in range(i, i + a):
                                for y in range(j, j + b):
                                    grid[x][y] = 0
                    return False
        return False

    grid = [[0] * W for _ in range(H)]
    tiles.sort(key=lambda x: x[0] * x[1], reverse=True)
    if dfs(H, W, 0, 0, grid):
        print("Yes")
    else:
        print("No")

N, H, W = map(int, input().split())
tiles = [list(map(int, input().split())) for _ in range(N)]
can_place_tiles(N, H, W, tiles)
