    elif rank[x_root] > rank[y_root]:
        parent[y_root] = x_root
    else:
        parent[y_root] = x_root
        rank[x_root] += 1

def kruskal(graph, n):
    mst_weight = 0
    edges = [(weight, u, v) for u, weight, v in graph]
    heapify(edges)
    parent = list(range(n + 1))
    rank = [0] * (n + 1)
    while edges:
        weight, u, v = heappop(edges)
        if find(parent, u) != find(parent, v):
            union(parent, rank, u, v)
            mst_weight += weight
    return mst_weight

