@lru_cache(None)
def dp(k, bits):
    if k == 0:
        return 1
    res = 0
    for i in range(26):
        if bits & (1 << i):
            res += dp(k - 1, bits & ~(1 << i)) * power(Cs[i], k - 1)
            res %= MOD
    return res

print(dp(K, (1 << 26) - 1))
