    for comb in combinations(range(N), k):
        diff = (A[comb[1]] - A[comb[0]]) * power(k - 1, MOD - 2) % MOD
        ok = True
        for i in range(2, k):
            if (A[comb[i]] - A[comb[i - 1]]) % (i * (k - 1)) != diff:
                ok = False
                break
        if ok:
            ans[k] += dp[A[comb[0]]]
            ans[k] %= MOD

