    root_x, root_y = find(x), find(y)
    if root_x != root_y:
        if rank[root_x] > rank[root_y]:
            parent[root_y] = root_x
        else:
            parent[root_x] = root_y
            if rank[root_x] == rank[root_y]:
                rank[root_y] += 1

mst_cost = 0
heapify(edges)
while edges:
    C, u, v = heappop(edges)
    if find(u) != find(v):
        union(u, v)
        mst_cost += C

connected = all(find(i) == find(1) for i in range(1, N + Q + 1))
print(mst_cost if connected else -1)
