import sys
from heapq import heapify, heappop
from collections import defaultdict

def main():
    N, Q = map(int, sys.stdin.readline().split())
    edges = []
    for _ in range(Q):
        L, R, C = map(int, sys.stdin.readline().split())
        edges.append((C, N + _, L, R))
    edges.sort()

    graph = defaultdict(list)
    for C, u, L, R in edges:
        for v in range(L, R + 1):
            graph[u].append((C, v))
            graph[v].append((C, u))

    parent = list(range(N + Q + 1))
    rank = [0] * (N + Q + 1)

    def find(u):
        if parent[u] != u:
            parent[u] = find(parent[u])
        return parent[u]

    def union(u, v):
        root1 = find(u)
        root2 = find(v)
        if root1 != root2:
            if rank[root1] > rank[root2]:
                parent[root2] = root1
            else:
                parent[root1] = root2
                if rank[root1] == rank[root2]:
                    rank[root2] += 1

    mst_cost = 0
    mst_edges = 0
    pq = [(C, u, v) for u in range(N + 1, N + Q + 1) for C, v in graph[u]]
    heapify(pq)

    while pq:
        C, u, v = heappop(pq)
        if find(u) != find(v):
            union(u, v)
            mst_cost += C
            mst_edges += 1
            if mst_edges == N + Q:
                break

    if mst_edges == N + Q:
        print(mst_cost)
    else:
        print(-1)

if __name__ == "__main__":
    main()
