    count = 0
    for px, py in points:
        if abs(x - px) + abs(y - py) <= D:
            count += 1
    return count

ans = 0
for x in range(-10**6, 10**6 + 1):
    for y in range(-10**6, 10**6 + 1):
        if all(abs(x - px) + abs(y - py) <= D for px, py in points):
            ans += 1

print(ans)
