import itertools
import sys

def read_graph():
    n = int(input())
    m = int(input())
    edges = set()
    for _ in range(m):
        u, v = map(int, input().split())
        edges.add(tuple(sorted((u, v))))
    return n, edges

def read_costs():
    costs = []
    for _ in range(n):
        costs.append(list(map(int, input().split())))
    return costs

def is_isomorphic(edges1, edges2, perm):
    for u, v in edges1:
        if (perm[u-1], perm[v-1]) not in edges2 and (perm[v-1], perm[u-1]) not in edges2:
            return False
    return True

def calculate_cost(edges1, edges2, perm, costs):
    cost = 0
    for u, v in edges1:
        if (perm[u-1], perm[v-1]) not in edges2 and (perm[v-1], perm[u-1]) not in edges2:
            cost += costs[u-1][v-1]
        elif (perm[u-1], perm[v-1]) in edges2 or (perm[v-1], perm[u-1]) in edges2:
            cost += costs[u-1][v-1]
    return cost

n, edges1 = read_graph()
_, edges2 = read_graph()
costs = read_costs()

min_cost = float('inf')
for perm in itertools.permutations(range(1, n+1)):
    if is_isomorphic(edges1, edges2, perm):
        cost = calculate_cost(edges1, edges2, perm, costs)
        min_cost = min(min_cost, cost)

print(min_cost)
