    for i in range(N):
        for j in range(max(0, i-K), min(N, i+K+1)):
            if i != j:
                graph[A[i]].append(B[j])

    visited = set()
    def dfs(node):
        if node in visited:
            return False
        visited.add(node)
        for neighbor in graph[node]:
            if not dfs(neighbor):
                return False
        visited.remove(node)
        return True

    possible = True
    for i in range(1, N+1):
        if not dfs(i):
            possible = False
            break

    print("Yes" if possible else "No")
