import sys

N = int(sys.stdin.readline())
edges = [list(map(int, sys.stdin.readline().split())) for _ in range(N - 1)]

parent = list(range(N + 1))
rank = [0] * (N + 1)

def find(x):
    if parent[x] != x:
        parent[x] = find(parent[x])
    return parent[x]

def union(x, y):
    root_x = find(x)
    root_y = find(y)
    if root_x != root_y:
        if rank[root_x] > rank[root_y]:
            parent[root_y] = root_x
        else:
            parent[root_x] = root_y
            if rank[root_x] == rank[root_y]:
                rank[root_y] += 1

for i in range(N // 2):
    union(2 * i + 1, 2 * i + 2)

leaves = [i for i in range(1, N + 1) if find(i) != i]

ans = []
for _ in range(N // 2):
    leaf1 = leaves.pop()
    leaf2 = leaves.pop()
    ans.append((leaf2, leaf1))

for x, y in ans:
